import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Profile = ({ username, setIsAuthenticated }) => {
  const navigate = useNavigate();
  
  return (
    <div>
      <h1>Profile Page</h1>
      <p>Gerencie seu perfil aqui.</p>
                {/* Exibir o nome do usuário ao lado do ícone de perfil */}
                {username && <span className="username">Olá, {username}</span>}
      
    </div>
  );
};

export default Profile;
